import React, { Component } from "react";
import {BrowserRouter as Link} from "react-router-dom"
class Header extends Component {
  constructor(props) {
    super(props);
    this.Header = this.Header.bind(this);
  }
  Header(){
       alert("Header home page");
  }
  render(){
   return (
        <div>
          {/*Header*/}
          {/*nav pill*/}
          <div id="header">
            <ul className="nav nav-pills justify-content-xl-end navbar-expand-lg ">
              <li className="nav-item">
                <NavLink className="nav-link avtive" href="#home">TRANG CHỦ</NavLink>

              </li>
              <li className="nav-item dropdown">
                <NavLink className="nav-link dropdown-toggle" data-toggle="dropdown" href="/">THỊ TRƯỜNG</NavLink>
                <div className="dropdown-menu">
                  <NavLink className="dropdown-item" href="/thi-truong/mua-tom">MUA TÔM</NavLink>
                  <NavLink className="dropdown-item" href="/thi-truong/ban-tom">ĐẶT MUA TÔM</NavLink>
                </div>
              </li>
              <li className="nav-item ">
                <NavLink className="nav-link text-dark" href="">VỀ CHÚNG TÔI</NavLink>
              </li>
              <li className="nav-item ">
                <NavLink className="nav-link text-dark" href="sign-up">Đăng Nhập</NavLink>
              </li>
              <li className="nav-item ">
                <NavLink className="nav-link text-dark" href="sign-in">Đăng kí</NavLink>
              </li>
            </ul>
          </div>
          {/*end nav pill*/}

          {/*banner*/}
          <p className="banner" />
          {/*end banner*/}

          {/*Header*/}
        </div>
      );
    }
  };
  export default Header;
